import "./App.css";
import "./style.css";
import { Nav, Navbar, Container, Button } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  return (
    <div className="App">
      <Navbar className="primary" sticky="top">
        <Navbar.Brand href="#home">
          <h2>the salad bowl</h2>
        </Navbar.Brand>
        <Nav>
          <Nav.Link href="#home">our story</Nav.Link>
          <Nav.Link href="#order">order online</Nav.Link>
          <Nav.Link href="#contact">contact us</Nav.Link>
        </Nav>
      </Navbar>
      <div className="bg"></div>

      <Container>
        <div className="contents">
          <h1 className="text-white">Make them feel your love.</h1>
          <h6 className="text-white">
            Lorem ipsum dolor sit amet, consectetur adipisicing elit. Rem
            repellendus quasi fuga nesciunt dolorum nulla magnam veniam
            sapiente, fugiat! Commodi sequi non animi ea dolor molestiae iste.
          </h6>
          <Button color="white">Download</Button>
        </div>
      </Container>
    </div>
  );
}

export default App;
